import React from "react";
import "./AdmissionButton.css";

const AdmissionButton = () => {
  return (
    <div className="admission-sticker-wrapper">
      <a href="" target="_blank" rel="noopener noreferrer" className="admission-sticker">
      </a>
    </div>
  );
};

export default AdmissionButton;
